    false,nt"url": null,nt"notes": "This report provides partial lists of both
    freshwater algae and benthic invertebrates found at the Montezuma National Wildlife
    Refuge and in Black Brook, a principle water source at the time this study was conducted.
    It further provides information on the following water quality parameters: pH, air
    temperature, water temperature, water depth, dissolved oxygen, conductivity, total
    coliform bacteria, water transparency, carbonates, chlorides, sulfates, and suspended
    solids. Lastly, it provides the results of analyses for several potentially harmful
    contaminants in the common carp (Cyprinus carpio), brown bullhead (Ictalurus nebulosus),
    largemouth bass (Micropterus salmoides), and snapping turtle (Chelydra serpentina).
    While no major concerns were identified, a baseline was established against which
    future changes can be compared.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
